import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <a id="link" download={"pal.bin"} style={{visibility: "hidden"}}/>
      <button onClick="setDownloadLinkForPalette()">Download pal.bin</button>

    </div>
  );
}

export default App;
